  input CP, D, RN, gnd, vdd;
  output Q;
  wire CP, D, RN, gnd, vdd;
  wire Q;
  wire next_state;
  reg  qi;
  assign #1 Q = qi;
  assign next_state = D;
  always 
    @(posedge CP or negedge RN) 
      if (!RN) 
        qi <= 0;
      else qi <= next_state;
  initial 
